import React from 'react'
import {makeStyles} from "@material-ui/core/styles"
import {Typography, Box} from "@material-ui/core";
import Navbar from "./Navbar"

const useStyles = makeStyles(theme=>({
    mainContainer: {
        background: "#4E538F"
    },
    timeLine: {
        position: "relative",
        padding: "16px",
        margin: "0 auto",
        "&:before": {
            content: "''",
            position: "absolute",
            height: "100%",
            border: "1px solid tan",
            right: "40px",
            top: 0
        },
        "&:after": {
            content: "''",
            display: "table",
            clear: "both"
        },
        [theme.breakpoints.up("md")]:{
            padding: "32px",
            "&:before": {
                left: "calc(50% - 1px)",
                right: "auto"
            }
        }
    },
    timeLineItem: {
       padding: "16px",
       borderBottom: " 2px solid tan",
       position: "realtive",
       margin: "16px 48px 16px 16px",
       clear: "both",
       "&:after": {
           content: "''",
           position: "absolute"
       },
       "&:before": {
        content: "''",
        position: "absolute",
        right: "-10px",
        top: "calc(50% - 5px)",
        borderStyle: "solid",
        borderColor: "red red transparent transparent",
        borderWidth: "10px",
        transform: "rotate(45deg)"
    },
        [theme.breakpoints.up("md")]: {
            width: "44%",
            margin: "16px",
            "&:nth-of-type(2n)": {
                float: "right",
                margin: "16px",
                borderColor: "tan"
            },
            "&:nth-of-type(2n):before": {
                right: "auto",
                left: "-10px",
                borderColor: "transparent transparent red red"
            }
        } 
    },
    timeLineYear: {
        textAlign: "center",
        maxWidth: "156px",
        margin: "0 3rem 0 auto",
        fontSize: "28.8px",
        background: "tomato",
        color: "white",
        lineHeight: 1,
        padding: "8px 0 16px",
        "&:before": {
            display: "none"
        },
            [theme.breakpoints.up("md")]: {
                textAlign: "center",
                margin: "0 auto",
                "&:nth-of-type(2n)": {
                    float: "none",
                    margin: "0 auto"
                },
                "&:nth-of-type(2n):before": {
                    display: "none"
                }
            }
    },
    heading: {
        color: "tan",
        padding: "48px 0",
        textTransform: "uppercase"
    },
    subHeading:{
        color: "tan",
        padding: "0",
        textTransform: "uppercase"
    }
}));

const Resume = () => {
    const classes = useStyles();
    return (
        <>
        <Navbar/>
        <Box component="header" className={classes.mainContainer}>
            <Typography variant="h4" align="center" className={classes.heading}>
                Resume
            </Typography>
            <Box component="div" className={classes.timeLine}>
                <Typography 
                variant="h2" 
                className={`${classes.timeLineYear} ${classes.timeLineItem}`}
                >
                    2020
                </Typography>
                <Box component="div" className={classes.timeLineItem}>
                    <Typography 
                    variant="h5" 
                    align="center" 
                    className={classes.subHeading}>
                        web app design
                    </Typography>
                    <Typography variant="body1" align="center">
                        sub title
                    </Typography>
                    <Typography variant="subtitle1" align="center">
                        Lorem ipsum adsfaesd fa aewfasfasf asddfawefa asfasfasfaqwf asf
                    </Typography>
                </Box>
            </Box>
        </Box>
        </>
    )
}

export default Resume
